script: |
  super -f text -I q7163.spq | sort > q7163.out

inputs:
  - name: q7163.spq
    data: |
      SELECT DISTINCT col0 + + 67 AS col1, col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( + col0 + - col1 * 66 * + 49 ) IS NOT NULL;
  - name: tab2

outputs:
  - name: q7163.out
    data: |
      113	46
      131	64
      142	75
